import React from 'react';
import NavBar from '../navBar/NavBar';
import Footer from '../footer/Footer';
import Typography from '@material-ui/core/Typography';
import styled from 'styled-components';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles(theme => ({
  root: {
    flexGrow: 1
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: 'center'
    // color: theme.palette.text.secondary
  }
}));

const WrapTitle = styled.div`
  padding-top: 10%;
  color: #757575;
`;
const WrapContent = styled.div`
  color: #757575;
  text-align: center;
`;

function Profile() {
  const classes = useStyles();
  return (
    <div className={classes.root}>
      <NavBar />
      <WrapTitle>
        <Typography
          variant="h2"
          component="h2"
          className="text-center"
          gutterBottom
        >
          About Us
          <hr width="150px" />
        </Typography>
      </WrapTitle>
      <WrapContent>
        <Typography>
          Berlokasi di Bandung, Indonesia, workshop kami merupakan rumah bagi
          sekelompok pelaku kreatif yang melihat kesempatan di antara hal-hal
          yang mustahil. Satu tujuan yang menggerakkan kami untuk kian
          berinovasi adalah menciptakan kontinuitas dengan kepercayaan atas
          komitmen dan orisinalitas untuk menciptakan penunjuk waktu yang
          senantiasa menginspirasi. Mengutamakan presisi dan kualitas di setiap
          detail terkecil, pengrajin kami menghadirkan sebuah jam tangan
          minimalis dengan sentuhan alam dan nuansa urban untuk setiap
          penggunanya. Melalui jam tangan MATOA, Your Signature starts here
        </Typography>
      </WrapContent>
    </div>
  );
}

export default Profile;
